import "./App.css"
import "./Animations.css"
import React from 'react';
import { useState, useEffect } from "react";

import TrainersAtHome from "./components/Home/TrainersAtHome";
import Processes from "./components/Home/Processes";
import GymInfos from "./components/Home/GymInfos";
import SubscriptionCards from "./components/Home/SubscriptionCards";
import Gallery from "./components/Home/Gallery"
import Opinions from "./components/Home/Opinions";
import Decorations from "./components/Home/Decorations";
import AOS from "aos";
import OriginalLogo from "./images/BlackLogo.png";
import WhiteLogo from "./images/WhiteGreenLogo.png"

import photo from "./images/child-with-gloves.jpg";
import ResearchIcon from "./images/research.png"
import FlaskIcon from "./images/flask.png";
import DashboardIcon from "./images/dashboard.png";
import ValueIcon from "./images/value.png";

import Footer from "./components/Footer";
import NavBar from "./components/NavBar";








function App() {






  useEffect(() => {
    AOS.init();
  }, []);




  function getWindowDimensions() {
    const { innerWidth: width, innerHeight: height } = window;


    return {
      width
    };
  }



  function useWindowDimensions() {
    const [windowDimensions, setWindowDimensions] = useState(getWindowDimensions());

    useEffect(() => {
      function handleResize() {
        setWindowDimensions(getWindowDimensions());
      }

      window.addEventListener('resize', handleResize);
      return () => window.removeEventListener('resize', handleResize);
    }, []);

    return windowDimensions;
  }


  let dimensions = useWindowDimensions();


  const trainers = [
    {
      id: 1,
      firstName: 'TAREK',
      lastName: 'Ashour',
      age: '30',
      bio: '',
    },
    {
      id: 2,
      firstName: 'OMAR',
      lastName: 'Attia',
      age: '22',
      bio: '',
    },
    {
      id: 3,
      firstName: 'ZEAD',
      lastName: 'Zooz',
      age: '22',
      bio: '',
    },
    {
      id: 4,
      firstName: 'HAIDY',
      lastName: 'Alsayed',
      age: '22',
      bio: '',
    },
    {
      id: 5,
      firstName: 'ZIYAD',
      lastName: 'Ashraf',
      age: '22',
      bio: '',
    },
    {
      id: 6,
      firstName: 'KOBE',
      lastName: 'HOLL',
      age: '22',
      bio: '',
    }
  ]

  const members = [
    {
      id: 1,
      firstName: 'Ziyad',
      lastName: 'Ashraf',
      age: '20',
      opinion: < p > This is the best place I’ve trained in so far! <br /> The community here is amazing.</p >,
      pp: photo,
      since: 2021

    },

    {
      id: 2,
      firstName: 'Ziyad',
      lastName: 'Ashraf',
      age: '20',
      opinion: < p > This is the best place I’ve trained in so far! <br /> The community here is amazing.</p >,
      pp: photo,
      since: 2021

    },

    {
      id: 3,
      firstName: 'Ziyad',
      lastName: 'Ashraf',
      age: '20',
      opinion: < p > This is the best place I’ve trained in so far! <br /> The community here is amazing.</p >,
      pp: photo,
      since: 2021


    }
  ]

  const processes = [
    {
      id: 'process-1',
      icon: ResearchIcon,
      description: <h4 className="process-desc">ANALYSE YOUR<br />GOALS</h4>,

    },
    {
      id: 'process-2',
      icon: FlaskIcon,
      description: <h4 className="process-desc">WORK HARD ON<br />IT</h4>,

    },
    {
      id: 'process-3',
      icon: DashboardIcon,
      description: <h4 className="process-desc">IMPROVE YOU<br />ON BASIS</h4>
      ,

    },
    {
      id: 'process-4',
      icon: ValueIcon,
      description: <h4 className="process-desc">ACHIEVE YOUR<br />DESTINY</h4>,
    }
  ]



  return (

    <div>


      <NavBar />

      <div id="contain-all">
        <div id="only-home">
          <div id="slogan" >
            <h1 >MAKE<br />YOUR HEALTH<br />A<br /><span>PRIORITY</span></h1>
          </div>
          {dimensions.width <= 949 &&
            <div><img src={WhiteLogo} width="125" height="115" alt="logo" /></div>
          }
          {dimensions.width > 949 &&
            <div> <img src={OriginalLogo} width="90" height="45" alt="logo" /></div>
          }
          {/* {<!-- <div className="contacts">
            <img src="images/facebook-app-symbol.png" class="contact-logo">
            <img src="images/instagram-logo.png" class="contact-logo">
            <img src="images/whatsapp.png" class="contact-logo">
            <img src="images/icons8-phone-30.png" class="contact-logo">
        </div> -->} */}
        </div>

        <div className="process-trainers">

          <Decorations nameclass="decorations-process" />

          <div className="process">

            <div className="headers-holder">
              <h2 className="info-headers" data-aos="fade-up">OUR PROCESS</h2>
            </div>
            <div className="process-info" >
              {processes.map((process) =>
                <Processes process={process} key={process.id} />
              )}
            </div>
          </div>

          <div className="gym-infos">

            <GymInfos />
          </div>

          <div className="gym-trainers">
            <div className="headers-holder">
              <h2 className="info-headers" data-aos="fade-up">OUR TRAINERS</h2>
            </div>
            <TrainersAtHome />
          </div>


        </div>



        <div className="gallery">
          <div className="headers-holder">
            <h2 className="info-headers black" data-aos="fade-up">GALLERY</h2>
          </div>
          <div className="gallery-container">
            <Gallery />
          </div>
        </div>



        <div className="subscription-plans">
          <Decorations nameclass="decorations-subscriptions-splash" />
          <div className="headers-holder">
            <h2 className="info-headers" data-aos="fade-up">SUBSCRIPTION PLANS</h2>
          </div>

          <SubscriptionCards />
          <Decorations nameclass="decorations-subscriptions-weightgirl" />

          <div className="ps-notes">
            *Classes count may differ between subscriptions.
          </div>


        </div>



